          text: 'I was very excited to give this Vizio 32 inch smart TV a try. I had considered a TV for my bedroom for many years. This Vizio TV has been a very welcomed addition. Setup was super easy and quick. The TV walks you through what needs to be done. This TV was very easy to mount to the wall using a mounting bracket (purchased separately). The TV and remote are an excellent quality. The picture quality is great. The sound is good for coming straight from the TV. I mainly use this TV to watch Netflix, with occasional Disney+ and Prime Video. How nice that these ALL have a button on the remote to link me directly to those apps. I am easily intimidated by technology. But this TV makes everything so easy! I absolutely love it. The one thing that I was disappointed to discover is that the HBO Max app is not yet available. Hopefully that will be available in the future. I also appreciate all of the Watch Free+ channels, which also has a button on the remote to directly take you to that area. There is something to please everyone. Overall, this TV is a great choice. I would not hesitate to buy another and I definitely would recommend it to anyone looking for a 32 inch smart TV that is reliable and easy to use.',
