          text: "Like everyone else says, don't pay scalper prices.  Be patient, watch online bots, and don't pay more than MSRP   tax (if applicable).  You don't have to rate a product 1 star because the sellers suck, though.\n\nI've been running my 5600X since right before Christmas, and it's a noticeable improvement from the i7 6700 I am running in an HP pre-built.  Though the i7 does seem to idle down more (reducing energy consumption), the R5 boosts so easily even without using PBO, and is overall more efficient.  I primarily mix and record music on my rigs, and sessions that would bottleneck on my i7 are putting my R5 at half load, enabling me to multitask proper.  I'm only running with 2133mhz RAM currently, and it's still blazing fast.  That, paired with PCIe 4.0 (working well with my B550 board and an RTX 3060Ti), I've got all the bandwidth I'll need for the next 5-7 years.  This is definitely the chip you want for most workloads, and it scales well for workstation tasks, and is great for gaming too!",
