          text: "[This review was collected as part of a promotion.] I have tried a number of other earbuds and before getting these had zero luck in finding a pair that were up to my challenges. I have a very active lifestyle  - beside my 'normal' everyday activities I practice yoga (including hot yoga) and bike - as in really bike. 20 miles a day minimum sun, rain or snow.  I listen to my playlists, fav podcasts but because I have \"weird\" ear canals I had yet to find in ear earbuds that would stay in during activity, much less provide great sound and noise cancelling. These earbuds do the job, they do better than the job because they greatly exceed any expectations. For example - this past weekend I did a century ride with my bike club. 100 miles, 10 hours later the music I listened to thru these earbuds kept me entertained and motivated because: \nA. theses wonderfully lightweight earbuds stayed in my 'weird' ear canals the entire time and I could not tell I was wearing them. OVer every bump and pothole they remained in place.\nB. Their charge lasted all day. I was done with the ride and wiped out, the battery on these was not.\nC. Sound quality is excellent, noise cancelling is excellent. Not that I would ever promote total noise cancelling when riding a bike on a road, the noise canceling did help eliminate hearing other riders chatter allowing me to focus.\nD. Styling is great, they are unobtrusive. The carrying case is small and well designed.\nI have also worn these during hot yoga-sweating and pretzel poses did not knock them out of my ears. End of session they were still snug, and again, listening to MY personal mix with noise cancelling helped me go through my flow without distractions..\nWith fall coming up and competitive MTB and cross track rides/races coming up I look forward to wearing these to block out noise  and help me focus during training. I have already worn them on some 15 mile MTB training rides over some pretty tough terrain and they performed great (and stayed in my ears)\nThis is a really great product and I am recommending  my fellow bikers try them out.",
