          text: "I have installed a couple TV wall mounts \r\nin the past, and I think this Sanus \r\nVuepoint FLT1 model is one of the more \r\nstraightforward to assemble and install \r\ncompared to the rest. I was lucky to find \r\none stud to mount one side with included\r\nbolts. The other side I had to use some \r\ndrywall anchors and my own drywall \r\nscrews, which holds just as strong. \r\n\r\nAlthough I appreciate the tilt and extend \r\nfunctionality, which is glides smoothly and \r\nstays sturdy, I just really needed my LED \r\nTV to be flat on the wall, which still rests \r\nperfectly without too much protrusion from \r\nthe wall. \r\n\r\nI have a 43\u201d TV and I mainly use it as an \r\nextended monitor at my desk in the \r\napartment living room. However, when \r\nI cook in the kitchen next to the living \r\nroom, I now have the option to tilt it 45 \r\ndegrees to watch TV more easily. All of \r\nmy HDMI cables are organized well \r\nbehind the TV and it's very easy to pull \r\nthe TV out to plug or unplug any cables. \r\n\r\nThe overall unit is relatively lightweight \r\nand easy to handle. It's well built and I \r\nbelieve it will last for future flatscreen \r\nTV upgrades and installs.",
