          text: "A review of the Sony MDR-EX14AP corded headphones that comes w/ three different sizes of hybrid silicone rubber earbuds, an in-line mic with a multi-function button on its backside (to click to answer or hang up calls, and do other functions while listening to music on an iPad or older iPhone) located a few inches down from the left earbud, an L-shaped 3.5 mm plug that plugs into the headphone jacks on these 3 devices: my laptop, iPad (6th generation), and iPhone 6s.\n\nSmallest earbuds worked best for me because I have small ear canal openings\u2026they block out other sounds quite well, and stay snuggly in my ear canal opening without feeling irritating. I haven't tested the mic by making a phone call yet, but other reviewers say it works well. I did test the earphone volume, and it gets plenty loud when I up the volume on my iPad or iPhone!\n\nTo test the sound quality, I listened to these songs: A Mad Russian's Christmas by Trans Siberian Orchestra, to test the bass and treble quality and sound of a multi-instrument song; Guns and Ships from Hamilton An American Musical, to test clarity of rapid fire vocalization and multi-part vocal harmonization; and Money by Pink Floyd to test the left\u2014right \u201cspeaker\u201d balance. These tested quite well for an inexpensive set of stereo headphones, not too far off from a much higher quality and much more expensive set of corded headphones I own.\n\nThese were reasonably priced and will work nicely when I don't have my wireless headphones charged or simply wish to watch videos or listen to music in bed where I'd be concerned about accidentally falling asleep and losing my AirPods in a mess of pillows and blankets.\n\nThis review was done three days after purchase, so I don't know how well these headphones will hold up, but fingers crossed that I'll get a good year's use out of them!",
