          text: '[This review was collected as part of a promotion.] Sony WH-1000XM5 has an excellent quality on sound, product and presentation! Again, Sony doesn\u2019t disappoint. The product presentation was high class. The case that stores the headphones is super nice and has a spot for the cables. Let\u2019s get to the good part, sound. The noise canceling was very noticeable. The sound is, quality to the max! I watched a movie and it was great, I took a phone call and it was great. The phone call, person on other end could kinda hear a conversation going on in background (about 6ft away) but my voice was the more prominent. I love the memory foam cushions around the ear and headband which makes for hours of listening time. Connection to my phone was a breeze.',
