          text: 'I was lucky and randomly found the Xbox Series S online at Walmart one day after I was looking for ( Still am ) a series X, I would like the disk drive for my movie collection and used game\u2019s but I still wanted something with the fast load times and the quick resume because the systems are hard to find at face value so I jumped on the S. Had it for over a month now and I\u2019m happy the controller is a great design like the classic Xbox controllers and they have a few updates. The internet speeds seem to be more stable and faster with a smooth UI. It\u2019s super small you\u2019ll be able to place it anywhere and Game Pass for a monthly fee seems to be really worth it and you\u2019ll get to maybe enjoy a game you would never had paid for! It could use use more memory it\u2019s around 380gb useable after the system is set up so that\u2019s a nice collection of game\u2019s depending on size. If you just want to play game\u2019s casually and have no use for a disk drive and you can stream video\u2019s, use app\u2019s, make friends and want the fancy pants system of the new age then get this system it\u2019s worth it at not even 320$ USD after tax. Thanks Walmart <3',
