          title: 'So glad we decided to move the tv to the wall',
          text: 'We had our 55" samsung tv atop our tv stand. It was fine, but I\'m so glad we decided to mount it on the wall instead of on the stands it came with. It really makes the top of the tv stand look clean, less cluttered, and will also make it easier to dust. It was difficult to wipe around those tv feet. This swivel mount also helps for if we are sitting in the dining area and we can easily pull out and turn the tv to face where we are, if not in the living room. It comes with all sorts of bolts depending on what your tv needs. There is a built-in level on the bracket itself which is super helpful. One person was able to mount it without needing a second person, but we are pretty "handy" so I\'m unsure if installation would be considered difficult or not. We had no issues with install and it works great. Allows the tv to be quite close to the wall so a nice clean look.',
