          text: "The  Mount-it!  seem to be heavy-duty compared to the televisions that I use them on 2 X 32 inch flat screens side-by-side  as PC monitors and 2 that are stacked. Came package very well with all the necessary hardware (screws, lag bolts, extensions and spacers) just a heads up there's lots of extra parts because of all the different setups the description is accurate the dimensions they say are accurate. Easy instructions mainly just pictures/diagram, for my setup I had to use a piece of 5/8 thick piece of plywood 1' x 2' lag bolted into the studs. Then mounted the \"MOUNT IT\" brackets to the plywood, of course I painted the plywood to match. The only issue I found is that they tighten everything very tight it cannot move  easily until it is mounted you might have to loosen then tighten them back up again when you're all done tweaking everything .  They worked out really well for me . All four of them are exactly the same I recommend  them and would buy again if necessary.",
