          text: "So I had been wary of getting this phone because of all the reviews, but i decided to try anyways because I figured i could always return it. After a month of having it, I can proudly say I'm in love! I was worried about not being compatible with my network because this is a 5G and mine is Verizon 4G LTE. I called their Customer Service, and they helped me get everything transferred to my new sim card, and everything stayed the same - except now i have 5G too! I love the size, its like holding a slim brick in my hand- I can customize my phone however I like. I love the camera - it takes great pictures and even better videos. I recommend getting a case for the protruding camera lens on the back - they seem like theyll get scratched up really easy.  The lag is pretty minimal, apps dowload really fast - it's amazing! I can make calls/videos call , send texts, gifs, and pictures with no problems. My phone battery is amazing - I casually be on my phone throughout the day and my phone will have plenty of juice all the way up to when it's time for bed. For the price, I think having all these wonderful qualities is basically a steal! The only real con I would say this phone has is the fact that this phone doesnt have built in wireless charger (but you can get an adapter to change that). All in all, I'm a happy camper, I absolutely adore my phone and I hope to have this in my hands for a long, long time!",
